## AVF_virus: The goals of this program are: 
## 1. Maximize SDC-AVF by maintaining high occupancy rates in the micro-architectural resources, including ROB, RS, IQ, DSB 
## 2. Exercise all 64-bit registers in the micro-architecture 3. Provide self-checkingness 4. Minimize DUE-AVF

.text
	.global main
main:
	## Get cpuid for the core on which the virus is executing
	xor %rbx, %rbx
	xor %rax, %rax
	mov $0x01, %eax
	cpuid
	shr $24, %ebx

	## delay added for the half of the parallel execution of the virus
	## if the cpuid is more than 30, add delay, else go on the label that starts the main execution
	##cmp $30, %ebx
    ##jl no_delay

	xor %rcx, %rcx
	##add $700000000, %rcx
    add %rbx, %rcx
    shl $25, %rcx
	add $7, %rcx
	loop_delay:
		nop
		loop loop_delay
	
no_delay:
	## Initialize and clear the general-purpose registers (GPRs)
    xor %rax, %rax
	xor %rcx, %rcx
	xor %rdx, %rdx
	xor %rdi, %rdi
	xor %rsi, %rsi
	xor %rbp, %rbp
	##xor %rsp, %rsp
	xor %r8, %r8
	xor %r9, %r9
	xor %r10, %r10
	xor %r11, %r11
	xor %r12, %r12
	xor %r13, %r13
	xor %r14, %r14
	xor %r15, %r15

	## Initialize and clear the XMM registers
	xorps %xmm0, %xmm0
	xorps %xmm1, %xmm1
	xorps %xmm2, %xmm2
	xorps %xmm3, %xmm3
	xorps %xmm4, %xmm4
	xorps %xmm5, %xmm5
	xorps %xmm6, %xmm6
	xorps %xmm7, %xmm7
	xorps %xmm8, %xmm8
	xorps %xmm9, %xmm9
	xorps %xmm10, %xmm10
	xorps %xmm11, %xmm11
	xorps %xmm12, %xmm12
	xorps %xmm13, %xmm13
	xorps %xmm14, %xmm14
	xorps %xmm15, %xmm15

	## Initialize and clear the MMX registers
	pxor %mm0, %mm0
	pxor %mm1, %mm1
	pxor %mm2, %mm2
	pxor %mm3, %mm3
	pxor %mm4, %mm4
	pxor %mm5, %mm5
	pxor %mm6, %mm6
	pxor %mm7, %mm7

	## Use cpuid for the core on which the virus is executing
	## to make sure it is accessing different/non-overlapped memory locations
	## than the other parallel executions of the program, add the offset that is 4K=1 page size apart.
	shl $12, %ebx

	## Get the appropriate memory locations offset based on cpuid
	xor %r14, %r14
	add %rbx, %r14
	
	## The outer-loop executes the operations such that the _Correct_
	## encoded message is printed every second in the serial port 
loop_outer:
	xor %rax, %rax
	xor %rbx, %rbx
	xor %rcx, %rcx
	xor %rdx, %rdx
	
	xor %r11, %r11
	add $4000000, %r11

	## The main loop starts
loop_main:

	## Initialize the registers for the correct locations for memory operations
	## For stores: get the base address from the num_array1 array and add the offset based on cpuid
	lea num_array1, %r15
	add %r14, %r15

	## For loads: get the base address from the num_array1 array and add the offset based on cpuid
	lea num_array1, %r10
	add %r14, %r10

	## To keep the ROB occupancy high, execution starts with long-latency sqrt operations on XMM registers
	## This keeps the "completed" entries of ROB occupied
	xor %rcx, %rcx
	add $2, %rcx

sqrt_loop:
	sqrtss %xmm0, %xmm1
	sqrtss %xmm1, %xmm2
	sqrtss %xmm2, %xmm3
	sqrtss %xmm3, %xmm4
	sqrtss %xmm4, %xmm5
	sqrtss %xmm5, %xmm6
	sqrtss %xmm6, %xmm7
	sqrtss %xmm7, %xmm8
	sqrtss %xmm8, %xmm9
	sqrtss %xmm9, %xmm10
	sqrtss %xmm10, %xmm11
	sqrtss %xmm11, %xmm12
	sqrtss %xmm12, %xmm13
	sqrtss %xmm13, %xmm14
	sqrtss %xmm14, %xmm15
	sqrtss %xmm15, %xmm0
	loop sqrt_loop
	
	sqrtss %xmm0, %xmm1
	sqrtss %xmm1, %xmm2
	sqrtss %xmm2, %xmm3
	sqrtss %xmm3, %xmm4
	sqrtss %xmm4, %xmm5
	sqrtss %xmm5, %xmm6
	sqrtss %xmm6, %xmm7
	sqrtss %xmm7, %xmm8
	sqrtss %xmm8, %xmm9
	sqrtss %xmm9, %xmm10
	sqrtss %xmm10, %xmm11
	sqrtss %xmm11, %xmm12
	sqrtss %xmm12, %xmm13
	sqrtss %xmm13, %xmm14
	sqrtss %xmm14, %xmm15
	sqrtss %xmm15, %xmm0
	
	## Store operations to 4 memory locations, the stores are done to 
	## sequential location that are 8bytes apart
	xor %r13, %r13
	add $4, %r13
store_loop:
	mov %r14, (%r15)
	add $8, %r15
	dec %r13
	cmp $0, %r13
	jnz store_loop

	## Parallel to the long-latency sqrt-operations, execute short-latency integer operations
	## to keep the "not completed" entries of the ROB and keep RS busy as well
	## These operations also exercise the remaining GPRs
	xor %r12, %r12
	add $1, %r12
inc_loop:
	add $2, %rax
	add %rax, %rbx
	sub $2, %rbx
	add $3, %rbx
	add %rbx, %rdx
	sub $3, %rdx
	add $4, %rdx
	add %rdx, %rdi
	sub $4, %rdi
	add $5, %rdi
	add %rdi, %rsi
	sub $5, %rsi
	add $6, %rsi
	add %rsi, %rbp
	sub $6, %rbp
	add $7, %rbp
	add %rbp, %r8
	sub $7, %r8
	add $8, %r8
	add %r8, %r9
	sub $8, %r9
	add $9, %r9

	sub $9,%r9
	add %r9, %r8
	sub $8,%r8
	add %r8, %rbp
	sub $7,%rbp
	add %rbp, %rsi
	sub $6,%rsi
	add %rsi, %rdi
	sub $5,%rdi
	add %rdi, %rdx
	sub $4,%rdx
	add %rdx, %rbx
	sub $3,%rbx
	add %rbx, %rax
	sub $2,%rax

	dec %r12
	cmp $0, %r12
	jnz inc_loop

	## Add more (12) memory operations, unrolled to exercise IQ
	mov %r14, (%r15)
	add $8, %r15

	mov %r14, (%r15)
	add $8, %r15

	mov %r14, (%r15)
	add $8, %r15

	mov %r14, (%r15)
	add $8, %r15
	
	mov %r14, (%r15)
	add $8, %r15

	mov %r14, (%r15)
	add $8, %r15

	mov %r14, (%r15)
	add $8, %r15

	mov %r14, (%r15)
	add $8, %r15

	mov %r14, (%r15)
	add $8, %r15

	mov %r14, (%r15)
	add $8, %r15

	mov %r14, (%r15)
	add $8, %r15

	mov %r14, (%r15)
	##add $8, %r15

	## Added extra (16) store operations to another memory location
	## to exercise SDB, without impacting the DUE-AVF much
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	mov %r14, (%r15)
	
	
	## Parallel to the long-latency sqrt-operations, execute short-latency integer operations
	## to keep the "not completed" entries of the ROB and keep RS busy as well
	## These operations exercise all the MMX registers
	movd %rax, %mm0
	xor %r12, %r12
	add $1, %r12
padd_loop:
	paddw %mm0, %mm1
	paddw %mm1, %mm2
	paddw %mm2, %mm3
	paddw %mm3, %mm4
	paddw %mm4, %mm5
	paddw %mm5, %mm6
	paddw %mm6, %mm7
	paddw %mm7, %mm0
	dec %r12
	cmp $0, %r12
	jnz padd_loop

	xor %r15, %r15
	add %r14, %r15

	## Self-checking begins
	## Self-check for the GPRs, all the calculations for most GPRs are done
	## such that their contents will be zero. So the comaprison are done with 0. 
	## If all the bits are zero, then there is no errors/bitflips, otherwise 
	## the execution jumps to the wrong output
	cmp $0, %rax
	jnz loop_wrong_int
	
	cmp $0, %rbx
	jnz loop_wrong_int
	
	cmp $0, %rcx
	jnz loop_wrong_int
	
	cmp $0, %rdx
	jnz loop_wrong_int
	
	cmp $0, %rdi
	jnz loop_wrong_int
	
	cmp $0, %rsi
	jnz loop_wrong_int
	
	cmp $0, %rbp
	jnz loop_wrong_int
	
	##cmp $0, %rsp
	##jnz loop_wrong_int
	
	cmp $0, %r8
	jnz loop_wrong_int
	
	cmp $0, %r9
	jnz loop_wrong_int

	cmp $0, %r12
	jnz loop_wrong_int
	
	cmp $0, %r13
	jnz loop_wrong_int
	
	cmp %r15, %r14
	jnz loop_wrong_int
	
	#####
	## Self-check for the XMM registers
	## The bit-wise OR operations accumulate all 
	## 128-bits of the registers to the xmm0 register
	orps %xmm1, %xmm0
	orps %xmm2, %xmm0
	orps %xmm3, %xmm0
	orps %xmm4, %xmm0
	orps %xmm5, %xmm0
	orps %xmm6, %xmm0
	orps %xmm7, %xmm0
	orps %xmm8, %xmm0
	orps %xmm9, %xmm0
	orps %xmm10, %xmm0
	orps %xmm11, %xmm0
	orps %xmm12, %xmm0
	orps %xmm13, %xmm0
	orps %xmm14, %xmm0
	orps %xmm15, %xmm0
	
	## Individual words (16-bits) are extracted from the xmm0 register
	## and checked if they are all zero. If all the bits are zero, 
	## then there is no errors/bitflips, otherwise the execution jumps to the 
	## wrong output
	pextrw $0, %xmm0, %eax
	cmp $0, %eax
	jne loop_wrong_fp

   	pextrw $1, %xmm0, %eax
   	cmp $0, %eax
	jne loop_wrong_fp

	pextrw $2, %xmm0, %eax
	cmp $0, %eax
	jne loop_wrong_fp

   	pextrw $3, %xmm0, %eax
   	cmp $0, %eax
	jne loop_wrong_fp

	pextrw $4, %xmm0, %eax
	cmp $0, %eax
	jne loop_wrong_fp

   	pextrw $5, %xmm0, %eax
   	cmp $0, %eax
	jne loop_wrong_fp

	pextrw $6, %xmm0, %eax
	cmp $0, %eax
	jne loop_wrong_fp

   	pextrw $7, %xmm0, %eax
   	cmp $0, %eax
	jne loop_wrong_fp

	## Self-check the contents of the 16 memory locations 
	## that were written earlier
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10
	
	mov (%r10), %r12
	cmp %r15, %r12
	jnz loop_wrong_mem
	add $8, %r10

	#####
	## Self-check for the MMX registers
	## The bit-wise OR operations accumulates all 
	## 64-bits of the registers to mm0 register
	por %mm1, %mm0
	por %mm2, %mm0
	por %mm3, %mm0
	por %mm4, %mm0
	por %mm5, %mm0
	por %mm6, %mm0
	por %mm7, %mm0
	
	## Individual words (16-bits) are extracted from the mm0 register
	## and checked if they are all zero. If all the bits are zero, 
	## then there is no errors/bitflips, otherwise the execution jumps to the 
	## wrong output
	pextrw $0, %mm0, %eax
	cmp $0, %eax
	jne loop_wrong_fp

   	pextrw $1, %mm0, %eax
   	cmp $0, %eax
	jne loop_wrong_fp

	pextrw $2, %mm0, %eax
	cmp $0, %eax
	jne loop_wrong_fp

   	pextrw $3, %mm0, %eax
   	cmp $0, %eax
	jne loop_wrong_fp

	##pextrw $4, %mm0, %eax
	##cmp $0, %eax
	##jne loop_wrong_fp

   	##pextrw $5, %mm0, %eax
   	##cmp $0, %eax
	##jne loop_wrong_fp

	##pextrw $6, %mm0, %eax
	##cmp $0, %eax
	##jne loop_wrong_fp

   	##pextrw $7, %mm0, %eax
   	##cmp $0, %eax
	##jne loop_wrong_fp

	## Jump to the main loop if the self-checking passes 
	## and outer-loop counter is non-zero
	dec %r11
	cmp $0, %r11
	jnz loop_main

	## Outputs cpuid in the most significant bit position (we right shift the content of rax from r14 by 10 bits to adjust the positions) 
	## and 00 in the least significant bit positions 
	## to acknowledge correct execution and jump to the outer-loop to initialize
    ## the counters and registers for next iteration
	xor %rax, %rax
	add %r14, %rax
	shr $10, %rax
	mov $0x3f8, %dx
	out %al, %dx

	jmp loop_outer

	## Jumps to the wrong loop if the self-checking fails, Outputs cpuid and 10 to acknowledge incorrect execution 
    ## for GPR, then the program terminates
	loop_wrong_int:
		xor %rax, %rax
		add %r14, %rax
		shr $10, %rax
		xor %rbx, %rbx
		add $1, %rbx
		or %rbx, %rax
		mov $0x3f8, %dx
		out %al, %dx
		
		jmp loop_exit
	
	## Jumps to the wrong loop if the self-checking fails, Outputs cpuid and 10 to acknowledge incorrect execution 
    ## for XMMs and MMXs, then the program terminates
    loop_wrong_fp:
		xor %rax, %rax
		add %r14, %rax
		shr $10, %rax
		xor %rbx, %rbx
		add $2, %rbx
		or %rbx, %rax
		mov $0x3f8, %dx
		out %al, %dx
		
		jmp loop_exit
	
	## Jumps to the wrong loop if the self-checking fails, Outputs cpuid and 11 to acknowledge incorrect execution 
    ## for memory locations, then the program terminates
	loop_wrong_mem:
		xor %rax, %rax
		add %r14, %rax
		shr $10, %rax
		xor %rbx, %rbx
		add $3, %rbx
		or %rbx, %rax
		mov $0x3f8, %dx
		out %al, %dx
		
		jmp loop_exit
loop_exit:
	mov $1, %eax
	mov $0, %ebx
	int $0x80

## Data segment containing the data array big enough to hold memory locations based on cpuid
